import React, { Component } from "react";

class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      showAbout: props.showAbout
    };
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.props.onClick();
    console.log("About is clicked to display:", this.state.showAbout);
  }
  render() {
    return (
      <header className="navbar">
        <div className="container">
          <div className="navbar-brand">
            <figure className="image is-64x64">
              <img
                className="is-rounded hvr-grow"
                src="https://i.imgur.com/24AJBmNs.png"
                alt="logo"
              />
            </figure>

            <div className="navbar-end">
              <a className="navbar-item " onClick={this.handleClick}>
                About Me
              </a>
              <a className="navbar-item">Portfolio</a>
              <a className="navbar-item">Contact</a>
            </div>
          </div>
        </div>
      </header>
    );
  }
}

export default Header;
